  return (
   <>
<Wrapper><div className='grid grid-four-column'>
{
  img.map((currentData,index) =>{
    return(
      <figure>
        <img 
        src={currentData.url} 
        alt={currentData.filename}
        key={index}
        />
      </figure>
    );
  })
}
</div>
